#h = [0.001 1 1000000]h = [0.001 0.2 1 5 10 100 1000]k = [2 3 5 7]for i=1:4  for j=1:7    compress("bart.png", k(i));    decompress("compressed.png", 1, k(i), h(j));    k(i)    h(j)    disp("O erro na bilinear é: ");    calculateError("bart.png", "decompressed.png");    decompress("compressed.png", 2, k(i), h(j));    disp("O erro na bicubica é: ");    calculateError("bart.png", "decompressed.png");  endforendfor